              console.log('Clicking map at:', lat, lng);

              let address;

              // Try OneMap first with commercial/industrial focus
              try {
                const response = await fetch(
                  `https://developers.onemap.sg/commonapi/revgeocode?location=${lat},${lng}&buffer=200&addressType=S&otherFeatures=true`
                );

                if (response.ok) {
                  const data = await response.json();
                  console.log('OneMap reverse geocoding response:', data);

                  if (data.results && data.results.length > 0) {
                    // Filter for commercial/industrial properties
                    const commercialResults = data.results.filter(result => {
                      const address = result.ADDRESS || '';
                      const type = result.TYPE || '';
                      return address.toLowerCase().includes('office') || 
                             address.toLowerCase().includes('commercial') ||
                             address.toLowerCase().includes('industrial') ||
                             address.toLowerCase().includes('warehouse') ||
                             address.toLowerCase().includes('factory') ||
                             address.toLowerCase().includes('shop') ||
                             address.toLowerCase().includes('mall') ||
                             address.toLowerCase().includes('building') ||
                             type.toLowerCase().includes('commercial') ||
                             type.toLowerCase().includes('industrial');
                    });

                    if (commercialResults.length > 0) {
                      address = commercialResults[0].ADDRESS;
                      console.log('Found commercial/industrial area:', address);
                    } else {
                      address = data.results[0].ADDRESS;
                      console.log('Using general area (may not be commercial):', address);
                    }
                  }
