              } catch (error) {
                console.log('OneMap reverse geocoding failed, trying OpenStreetMap...');
              }

              // Fallback to OpenStreetMap if OneMap fails
              if (!address) {
                try {
                  const response = await fetch(
                    `https://nominatim.openstreetmap.org/reverse?lat=${lat}&lon=${lng}&format=json&addressdetails=1`
                  );
                  const data = await response.json();
                  console.log('OpenStreetMap reverse geocoding response:', data);

                  // Check if this area has commercial characteristics
                  const addressParts = data.display_name.toLowerCase();
