                                         addressParts.includes('office') ||
                                         addressParts.includes('shop') ||
                                         addressParts.includes('mall');

                  address = data.display_name;
                  if (isCommercialArea) {
                    console.log('Found commercial/industrial area via OpenStreetMap:', address);
                  } else {
                    console.log('Using general area (may not be commercial):', address);
