              const fallbackAddress = `Lat: ${lat.toFixed(6)}, Lng: ${lng.toFixed(6)}`;
              setClickedAddress(fallbackAddress);
              setSearchAddress(fallbackAddress);
              marker.bindPopup(`<b>Coordinates:</b><br>${fallbackAddress}`).openPopup();
