        console.log('Search response:', data);

        // Handle both OneMap and OpenStreetMap response formats
        let lat, lng, address;
        let isCommercial = false;

        if (data.results && data.results.length > 0) {
          // OneMap format - filter for commercial/industrial properties
          const commercialResults = data.results.filter(result => {
            const address = result.ADDRESS || '';
            const type = result.TYPE || '';
