            const result = data.results[0];
            lat = parseFloat(result.LATITUDE);
            lng = parseFloat(result.LONGITUDE);
            address = result.ADDRESS;
            console.log('No commercial properties found, using:', address);
          }
        } else if (data.length > 0) {
          // OpenStreetMap format - filter for commercial/industrial properties
          const commercialResults = data.filter(result => {
            const displayName = result.display_name || '';
            const type = result.type || '';
            return displayName.toLowerCase().includes('office') || 
                   displayName.toLowerCase().includes('commercial') ||
                   displayName.toLowerCase().includes('industrial') ||
                   displayName.toLowerCase().includes('warehouse') ||
                   displayName.toLowerCase().includes('factory') ||
                   displayName.toLowerCase().includes('shop') ||
                   displayName.toLowerCase().includes('mall') ||
                   displayName.toLowerCase().includes('building') ||
                   type.toLowerCase().includes('commercial') ||
                   type.toLowerCase().includes('industrial');
          });

          if (commercialResults.length > 0) {
            const result = commercialResults[0];
            lat = parseFloat(result.lat);
            lng = parseFloat(result.lon);
            address = result.display_name;
            isCommercial = true;
            console.log('Found commercial/industrial property:', address);
          } else {
            // Fallback to first result if no commercial properties found
            const result = data[0];
            lat = parseFloat(result.lat);
            lng = parseFloat(result.lon);
            address = result.display_name;
            console.log('No commercial properties found, using:', address);
